import React from 'react'
import { Link } from 'react-router-dom'


const Table = (props)=>{
    return(
        <div>
            <div className="z-depth-4">
            <table className="responsive-table centered bordered">
                                    <thead>
                                    <tr>
                                        {
                                            props.props.THead.map((THcontent , index) => {
                                                return(
                                                    <th>{THcontent}</th>
                                                )
                                            })
                                        }
                                    </tr>
                                    </thead>

                                    {
                                        
                                        props.props.TData.map((TBodyData , index) => {
                                            var TableRow = Object.keys(TBodyData).map(function(key) {
                                                return TBodyData[key];
                                              });
                                            return (
                                                <tbody key = {TableRow[0]} className = {TableRow[0]}>
                                                <tr >
                                                    <td>{TableRow[1]}</td>
                                                    <td>{TableRow[2]}</td>
                                                    <td>
                                                        <Link 
                                                        to={{pathname :`/operations/country/update`,
                                                        state: {countryId:TableRow[0]}
                                                            }}><i className="material-icons">edit</i>
                                                        </Link>
                                                        <i className="material-icons small">more_vert</i>
                                                        
                                                        {
                                                            TableRow[2] == 'Active'?
                                                            <i className="material-icons" style={{cursor:'pointer'}} onClick={()=>this.countryDelete(TableRow[0])}>check_circle</i>:
                                                            <i className="material-icons" style={{cursor:'pointer'}} onClick={()=>this.countryDelete(TableRow[0])}>block</i>
                                                        }
                                                        
                                                        
                                                    </td>
                                                </tr>
                                                </tbody>
                                                );
                                            
                                        })
                                    }
                                </table>
            </div>
        <div/>
        </div>
    )
}

export default Table
